import Link from "next/link";
import { getFaqs, createFaq } from "../../server/controllers/fag.controller";
import Faqs from "../../server/models/Fag.model";

export default function Details({ faqs }) {
  console.log(faqs);
  return (
    <div>
      <h1>Details Route</h1>
      <Link href='/'>
        <a>Go Back</a>
      </Link>
    </div>
  );
}

export const getStaticProps = async () => {
  const faqs = await Faqs.find();

  return {
    props: { faqs },
  };
};
